n, m = map(int, input().split())
edges = []
for _ in range(m):
    u, v = map(int, input().split())
    edges.append((u, v))

reachable = set()
for u, v in edges:
    if u == 1:
        reachable.add(v)

possible = False
for u1, v1 in edges:
    if v1 in reachable and v1 != n:
        for u2, v2 in edges:
            if u2 == v1 and v2 == n:
                possible = True
                break
    if possible:
        break

if possible:
    print("POSSIBLE")
else:
    print("IMPOSSIBLE")

